import React from "react";

class Info extends React.Component {
  render() {
    return (
      <div className="Info">
        <p>
          Want more?{" "}
          <a
            onClick={() => {
              showDialogModal;
            }}
          >
            Log in!
          </a>
        </p>
      </div>
    );
  }
}
export default Info;
